// src/components/MyChart.js
import React from 'react';
import { Line } from 'react-chartjs-2';

const MyChart = () => {
  // Sample line graph data
  const data = {
    labels: ['Trip 1', 'Trip 2', 'Trip 3', 'Trip 4', 'Trip 5'],
    datasets: [
      {
        label: 'Passengers',
        data: [25, 30, 22, 27, 33],
        borderColor: '#717D84',
        backgroundColor: '#C9D1D8',
        fill: true,
        tension: 0.4,
      },
    ],
  };

  return (
    <div>
      <h3>Passenger Statistics</h3>
      <Line data={data} />
    </div>
  );
};

export default MyChart;
